import React from "react";
import {Container, Navbar, Nav, Row } from "react-bootstrap";
import "./Footer.css";



const Footer = () => {
    return (
      <div className="Footer">
        <div style={{background: "black", paddingTop: "100pt", paddingBottom: "100pt"}}>
          <Container>
            <Row>

            </Row>
          </Container>
        </div>

        <Navbar expand="md" variant="dark" className="nav">
          <Container>
            <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
              <Nav
                className="ml-2 my-2 my-lg-0"
                style={{ maxHeight: '100px' }}
                navbarScroll
              >
              <Nav.Link href="#action1">Products</Nav.Link>
              <Nav.Link href="#action1">Features</Nav.Link>
              <Nav.Link href="#action1">Contact</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
      </div>
     );
}

export default Footer;
